import { AssignType } from "../client";
export class WeverseComment extends AssignType() {
    constructor(props, post, artist) {
        super(props);
        this.artist = artist;
        this.post = post;
    }
    toJSON() {
        const partial = Object.assign({}, this);
        delete partial.artist;
        delete partial.post;
        return partial;
    }
}
